import React from 'react'

const App = (props) => {
  const { notes } = props
  notes.map(note => <li>{note.content}</li>)
  return (
    <div>
      <h1>Notes</h1>
      <ul> {notes.map(note => <li>{note.content}</li>)} </ul>
    </div>
  )
}

export default App
